import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

import './pages/assets/pages/waves/css/waves.min.css';
import './pages/assets/css/bootstrap/css/bootstrap.min.css';
import './pages/assets/pages/waves/css/waves.min.css';
import './pages/assets/icon/font-awesome/css/font-awesome.min.css';
import './pages/assets/icon/icofont/css/icofont.css';
import './pages/assets/css/jquery.mCustomScrollbar.css'
import './pages/assets/js/popper.js/popper.min.js';
import './pages/assets/pages/waves/js/waves.min.js';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
